import React from "react";
import Navbar from "./navbar";
import "./products.css"


function ViewProducts(){
    return(
        <div id="product-page">
        <div id="product-image">
            <a>Minimalist Sunscream (50 SPF)</a>
            <a>249Rs/-</a>
        </div>
        <div id="product-desc">
        </div>
        </div>

    )
}



export default function Products(){
    return(
        <div>
            <Navbar />
            <ViewProducts />

        </div>
    )
}
